import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Axios from "axios";
import { BrowserRouter as Router, Route, Link, Switch, useParams } from "react-router-dom";
import React, { useState, useEffect, Component, Fragment  } from 'react';
import { AgGridColumn, AgGridReact } from 'ag-grid-react';
//import 'ag-grid-enterprise';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';
import BtnCellRenderer from './btn-cell-renderer.jsx';
//modal imports
import { Container } from './Container';
import 'bootstrap/dist/css/bootstrap.min.css';
import InputGroup from 'react-bootstrap/InputGroup'
import FormControl from 'react-bootstrap/FormControl'


export class Validar extends Component {
  constructor(props) {
    super(props);

    this.state = {};

    this.textChangeHandler = this.textChangeHandler.bind(this);

  }

  textChangeHandler = (e) => {
   //console.log(e.target.value);
   try {
       Axios.post('http://3.23.104.36:3001/cuponesValidar',{
       id:e.target.value
   })
    .then(res => {
      console.log(res.data);
    })
   } catch (error) {
       console.log('error');
   }
   ;
};

  render() {
    return (
      <div>
        <InputGroup size="lg">
            <InputGroup.Prepend>
            <InputGroup.Text id="inputGroup-sizing-lg">Cupon</InputGroup.Text>
            </InputGroup.Prepend>
            <FormControl aria-label="Large" aria-describedby="inputGroup-sizing-sm" onChange={this.textChangeHandler}/>
        </InputGroup>

          <div style={{marginLeft: '9px', marginTop: '7px' }}>
          <Container triggerText={'Editar'} 
          formId={this.state.id} 
          formEstablecimiento={this.state.establecimiento}
          formEstatus={this.state.estatus}
          formProducto={this.state.producto}
          formSerie={this.state.serie}
          formVigencia={this.state.vigencia} 
          onSubmit={this.onSubmit} 
          classButton={"btn btn-primary btn-sm modal-button"}
          formType={'1'}/>
          </div>
      </div>


    );
  }
}

export default Validar;
